COPY public.magnet_app_dataset (id, dataset_name, full_title, authors, publication_year, journal, link_to_pubmed, abstract) FROM stdin;
2	Lavin Et al. 2014	Tissue-resident Macrophage Enhancer Landscapes Are Shaped by the Local Microenvironment	Yonit Lavin, Deborah Winter, Ronnie Blecher-Gonen, Eyal David 2, Hadas Keren-Shaul, Miriam Merad, Steffen Jung, Ido Amit	2014	Cell	https://pubmed.ncbi.nlm.nih.gov/25480296/	Macrophages are critical for innate immune defense and also control organ homeostasis in a tissue-specific manner. They provide a fitting model to study the impact of ontogeny and microenvironment on chromatin state and whether chromatin modifications contribute to macrophage identity. Here, we profile the dynamics of four histone modifications across seven tissue-resident macrophage populations. We identify 12,743 macrophage-specific enhancers and establish that tissue-resident macrophages have distinct enhancer landscapes beyond what can be explained by developmental origin. Combining our enhancer catalog with gene expression profiles and open chromatin regions, we show that a combination of tissue- and lineage-specific transcription factors form the regulatory networks controlling chromatin specification in tissue-resident macrophages. The environment is capable of shaping the chromatin landscape of transplanted bone marrow precursors, and even differentiated macrophages can be reprogrammed when transferred into a new microenvironment. These results provide a comprehensive view of macrophage regulatory landscape and highlight the importance of the microenvironment, along with pioneer factors in orchestrating identity and plasticity.
3	Matcovitch-Natan O. Et al. 2016	Microglia development follows a stepwise program to regulate brain homeostasis.	Orit Matcovitch-Natan, Deborah R Winter, Amir Giladi, Stephanie Vargas Aguilar, Amit Spinrad, Sandrine Sarrazin, Hila Ben-Yehuda, Eyal David, Fabiola Zelada Gonzlez, Pierre Perrin, Hadas Keren-Shaul, Meital Gury, David Lara-Astaiso, Christoph A Thaiss, Merav Cohen, Keren Bahar Halpern, Kuti Baruch, Aleksandra Deczkowska, Erika Lorenzo-Vivas, Shalev Itzkovitz, Eran Elinav, Michael H Sieweke, Michal Schwartz, Ido Amit	2016	Science	https://pubmed.ncbi.nlm.nih.gov/27338705/	Microglia, the resident myeloid cells of the central nervous system, play important roles in life-long brain maintenance and in pathology. Despite their importance, their regulatory dynamics during brain development have not been fully elucidated. Using genome-wide chromatin and expression profiling coupled with single-cell transcriptomic analysis throughout development, we found that microglia undergo three temporal stages of development in synchrony with the brain--early, pre-, and adult microglia--which are under distinct regulatory circuits. Knockout of the gene encoding the adult microglia transcription factor MAFB and environmental perturbations, such as those affecting the microbiome or prenatal immune activation, led to disruption of developmental genes and immune response pathways. Together, our work identifies a stepwise microglia developmental program integrating immune response pathways that may be associated with several neurodevelopmental disorders.
4	Gautier Et al. 2012	Gene expression profiles and transcriptional regulatory pathways underlying mouse tissue macrophage identity and diversity	Emmanuel L Gautier, Tal Shay, Jennifer Miller, Melanie Greter, Claudia Jakubzick, Stoyan Ivanov, Julie Helft, Andrew Chow, Kutlu G Elpek, Simon Gordonov, Amin R Mazloom, Avi Maayan, Wei-Jen Chua, Ted H Hansen, Shannon J Turley, Miriam Merad, Gwendalyn J Randolph, Immunological Genome Consortium	2012	Nature Immunology	https://pubmed.ncbi.nlm.nih.gov/23023392/	We assessed tissue macrophage gene expression in different mouse organs. Diversity in gene expression among different populations of macrophages was remarkable. Only a few hundred mRNA transcripts stood out as selectively expressed by macrophages over DCs and many of these were not present in all macrophages. Nonetheless, well-characterized surface markers, including MerTK and FcR1 (CD64), along with a cluster of novel transcripts were distinctly and universally associated with mature tissue macrophages. TCEF3, C/EBP, BACH1, and CREG-1 were among the top transcriptional regulators predicted to regulate these core macrophage-associated genes. Other transcription factor mRNAs were strongly associated with single macrophage populations. We further illustrate how these transcripts and the proteins they encode facilitate distinguishing macrophage versus DC identity of less characterized populations of mononuclear phagocytes.
\.
